class Solution {

    /**
     * @param Integer[][] $dimensions
     * @return Integer
     */
    function areaOfMaxDiagonal($dimensions) {
        $maxDiagonal = 0;
        $maxArea = 0;
        foreach ($dimensions as $dimension) {
            $length = $dimension[0];
            $width = $dimension[1];
            $diagonal = sqrt($length * $length + $width * $width);
            $area = $length * $width;

            // Check if current diagonal is greater than the max found so far
            // or if it is equal but the area is greater
            if ($diagonal > $maxDiagonal || ($diagonal == $maxDiagonal && $area > $maxArea)) {
                $maxDiagonal = $diagonal;
                $maxArea = $area;
            }
        }
        return $maxArea;
    }
}
